import React from 'react';
import {Router, Switch} from 'react-router-dom'
import './App.css';
import Home from './components/home';

function App() {
  return (
    <div className="App">
      <Switch>
        <Router exact path="/" component={Home} />
      </Switch>
    </div>
  );
}

export default App;
